import React from 'react'

import { useNavigate } from 'react-router-dom'

const DogList = ({dogs}) => {

    const navigate = useNavigate()
    return(
    <>
        <h1>Dog List</h1>
        {dogs.map(dog => 
        <div onClick={() => navigate(`${dog.name}`)}>
            <h1>{dog.name}</h1>
            <img src={require(`./${dog.src}.jpg`)} alt='image of dog'></img>
        </div>
        )}
    </>
    )
}

export default DogList;
